  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:21.400007\",\n\t\"name\": \"upper-mississippi-river-national-wildlife-and-fish-refuge-savanna-district-annual-narrat-2-17f39\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the Savanna
  District of the Upper Mississippi River National Wildlife and Fish Refuge summarizes
  Refuge activities during the 2008 fiscal year.  The report begins with an introduction
  to the Refuge and a summary of the yearu2019s highlights and climate conditions.
  \ Information about monitoring and studies- including surveys and censuses- is provided
  next.  Habitat restoration and management projects are also covered; activities
  include wetland restoration, water level management, moist soil management, mowing,
  timber management, fire management, and vegetation control.  Fish and wildlife management
  is discussed next with emphasis on bird banding, disease monitoring, reintroductions,
  nest structures, and invasive animal control.  Coordination activities, such as
  interagency coordination and private land activities, are outlined.  The resource
  protection section provides information about law enforcement, permits, contaminant
  investigation, contaminant cleanup, and land acquisition support.  Information about
  public education and recreation is given including visitor services and outreach.
  Refuge planning and administration are discussed.\",\n\t\"license_title\": \"License
